&lt;p&gt;
Da ! Heard it Records is a netlabel since 2006. The aim of this eclectic record company is to promote new artists and new types if music. D!HR is an outward-looking label, accessible to professional and amateur musicians alike, and to all types of listener, thanks to its policy of open and free culture and to the types of music it publishes. Its albums are distributed under a Creative Commons licence, encouraging sharing and reuse of the music.
&lt;/p&gt;

&lt;p&gt;&lt;a href=&quot;http://www.daheardit-records.net&quot;&gt;www.daheardit-records.net&lt;/a&gt;&lt;/p&gt;

